import React from "react";
import '../styles/index1.css';
const ResumeBuilder = () => {
	return (
		<div>
			<Header />
			<section class="section" style={{ marginBottom: "0" }}>
				<div class="container container-center">
					<h1>ResumeBuilder</h1>
				</div>
			</section>
		</div>
	);
};

export default ResumeBuilder;
